text":"I can\u2019t believe it\u2019s been a year since I\u2019ve posted. I feel it\u2019s exactly what I had to do to overcome such an extreme diagnosis. As my life became quieter, my faith and optimism grew towards my health. I started to squeeze those around me tighter, I started to laugh more until my belly hurt and wow, as time grew so did my confidence in knowing I would be just fine. My ENTIRE heart goes out to those effected by any disease especially cancer as I know what fear and pain go with any diagnosis. I have a purpose now, I was given a platform to make a difference and wholeheartedly help those who are suffering at any degree. I am so fulfilled to have the opportunity to have partnered with @eylureofficial @ultabeauty @bcrfcure where a large portion of my lashes will fund research in hopes to find a cure for #breastcancer . This is the start to something so beautiful and I\u2019m so grateful for all of you who have supported me thus far. I\u2019ll never forget your love \u2764\ufe0f thank you from my entirety.\n\n#PinkGlamor #UltaBeauty #bcrf #bcrfCure #vegas_nay #eylure #eylurelashes  #Ulta #vegasnay #vegasnaylashes"}}]},"edge_media_to_comment":{"count":1331},"comments_disabled":false,"taken_at_timestamp":1571106348,"edge_liked_by":{"count":29402},"edge_media_preview_like":{"count":29402},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.186.480.480a/71675530_444322386200636_670086865933880672_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=dIfnzp5JlG0AX9dfnxV\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=3314a5b8af58d2a82df2e4c703e912a8\u0026oe=6070C40B\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/p150x150/71675530_444322386200636_670086865933880672_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=dIfnzp5JlG0AX9dfnxV\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=0269ba9efc443       request_url: errUrl.indexOf('direct') >= 0 ? 'direct' : errUrl,
      response_status_code: errorInfo.statusCode || 0
    }
  }
  window.addEventListener('load', function(){
    if (window.__bufferedErrors && window.__bufferedErrors.length) {
      if (window.caches && window.caches.keys && window.caches.delete) {
        window.caches.keys().then(function(keys) {
          keys.forEach(function(key) {
            window.caches.delete(key)
          })
        })
      }
      window.__bufferedErrors.map(function(error) {
        return normalizeError(error)
      }).forEach(function(normalizedError) {
        var request = new XMLHttpRequest();
        request.open('POST', '/client_error/', true);
        request.setRequestHeader('Content-Type', 'application/json; charset=utf-8');
        request.send(JSON.stringify(normalizedError));
      })
    }
  })
}());
